import axios from "axios";
import { useEffect } from "react";
import { useState } from "react";
import { useHistory } from "react-router-dom/cjs/react-router-dom.min";

function PatientAppointments() {
    const history=useHistory();
    const id= window.sessionStorage.getItem("userId");
    var aid=0

    const Home=()=>{
        history.push("/PatientHome");
    }

    const [hospitalDetails,sethospitalDetails]=useState({
                              hospitalName : "",
                              hospitalInfo: "",
                              addressLineOne: "",
                              addressLineTwo: "",
                              email: "",
                              mobNumber: "",
                              password: "",
                              imagePath: "",
                              id: 0,
                              workingDays: 0
                            });

const [doctorDetails,setDoctorDetails]=useState({
                              firstName: "",
                              lastName: "",
                              gendeer: "",
                              email: "",
                              mobNumber: "",
                              password: "",
                              addressLineOne: "",
                              addressLineTwo: "",
                              experience: 0,
                              speciality: "",
                              charges: 0,
                              imagePath: "",
                              id: 0
                            });

    const[appointments,setAppointments]=useState([
        {
          startDate: "",
          status: "",
          diseases: "",
          cost: 0,
          id: 0
        }
    ])


    useEffect(()=>{
      var helper=new XMLHttpRequest;
      helper.onreadystatechange=()=>{
          if(helper.readyState==4&&helper.status==200){
              var data=JSON.parse(helper.responseText);     
              //console.log(data);
              setAppointments(data);
          }
      };
      helper.open('GET','http://localhost:7070/appointment/patient/%7Bdid%7D?pID='+id);
      helper.setRequestHeader("Content-Type","application/json");
      helper.send();
    },[]);

    useEffect(()=>{
      hospital(window.sessionStorage.getItem("aId"));
          doctor(window.sessionStorage.getItem("aId"));
    },[appointments]);


   const hospital= (aid)=>{
      var helper=new XMLHttpRequest;
      helper.onreadystatechange=()=>{
          if(helper.readyState==4&&helper.status==200){
              var data=JSON.parse(helper.responseText);     
              //console.log(data);
              sethospitalDetails(data);
          }
      };
      helper.open('GET','http://localhost:7070/appointment/single/hospital/{hid}?hID='+aid);
      helper.setRequestHeader("Content-Type","application/json");
      helper.send();
    };

   const doctor= (aid)=>{
      var helper=new XMLHttpRequest;
      helper.onreadystatechange=()=>{
          if(helper.readyState==4&&helper.status==200){
              var data=JSON.parse(helper.responseText);     
              //console.log(data);
              setDoctorDetails(data);
          }
      };
      helper.open('GET','http://localhost:7070/appointment/single/doctor/{did}?dID='+aid);
      helper.setRequestHeader("Content-Type","application/json");
      helper.send();
    };



    return ( 
        <>
             <nav class="navbar navbar-expand-lg bg-body-tertiary rounded" aria-label="Thirteenth navbar example">
      <div class="container-fluid">
        <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarsExample11" aria-controls="navbarsExample11" aria-expanded="false" aria-label="Toggle navigation">
          <span class="navbar-toggler-icon"></span>
        </button>

        <div class="collapse navbar-collapse d-lg-flex" id="navbarsExample11">
          {/* <a class="navbar-brand col-lg-3 me-0" href="#">Home</a> */}

          <div class="navbar-brand col-lg-1 me-0 btn" aria-current="page" onClick={Home}>Home</div>
          <div class="navbar-brand col-lg-1 me-0" aria-current="page"></div>
          <div class="navbar-brand col-lg-1 me-0 " aria-current="page"></div>

          <ul class="navbar-nav col-lg-6 justify-content-lg-center">

          </ul>

        </div>
      </div>
    </nav>
    <div className="container" style={{marginTop:20}}>
    <table class="table text-center">
  <thead>
    <tr>
      <th scope="col">sr no</th>
      <th scope="col">Hospital Name</th>
      <th scope="col">Hospital Address</th>
      <th scope="col">Doctor name</th>
      <th scope="col">diseases</th>
      <th scope="col">Date</th>
      <th scope="col">Status</th>
      <th scope="col">Action</th>
    </tr>
  </thead>
  <tbody>
      {
        appointments.map((appointment)=>{
          // window.sessionStorage.setItem("aId",appointment.id);
          return <>
          <tr>
              <th scope="row">1</th>
              {/* <td>{hospitalDetails.hospitalName}</td>
              <td>{hospitalDetails.addressLineOne}</td>
              <td>{doctorDetails.firstName+" "+doctorDetails.lastName}</td> */}
              <td>{appointment.diseases}</td>
              <td>{appointment.startDate}</td>
              <td>{appointment.status}</td>
              <td class="nav-item" style={{marginLeft:20}}> 
                    <div class="nav-link active btn btn-warning" aria-current="page">Cancel</div>
              </td>
          </tr>
          </>
        })

      }


    <tr>
      <th scope="row">1</th>
      <td>Hospital Name</td>
      <td>Hospital Address</td>
      <td>Otto</td>
      <td>20-10-23</td>
      <td>Pending</td>
      <td class="nav-item" style={{marginLeft:20}}> 
            <div class="nav-link active btn btn-warning" aria-current="page">Cancel</div>
      </td>
    </tr>
  </tbody>
</table>
    </div>
        </>
     );
}

export default PatientAppointments;
